import React from 'react'

const ScoreDisplay =( props )=> {

    const { name, highScore, currentScore } = props

    return (
        <div className='score-display'>
            <div>
                High Score: { highScore }
            </div>
            <div>
                By: { name }
            </div>
            <div>
                Your Score: { currentScore }
            </div>
        </div>
    )
}

export default ScoreDisplay
